import App from "../App";

import '../App.css';

function Type(){
    return(
  <div>
 <p className="ttt">
     <b><h1>Sharma Transports Bus Types</h1></b> <br/>
        <p>The various types of buses run by Sharma Transports are:</p>
        
            <h3>A/C Sleeper (2+1)</h3>
            <li>NON A/C Sleeper (2+1)</li>
            <li>Volvo Multi-Axle A/C Sleeper (2+1)</li>
            <li>Volvo Multi-Axle A/C (2+2)</li>
            <li>Volvo A/C Semi Sleeper (2+2)</li>
            <li>A/C Sleeper (2+1)</li>
            <li>Volvo Multi-Axle A/C Semi Sleeper (2+2)</li>
            <li>Volvo Multi-Axle I-Shift A/C Semi Sleeper (2+2)</li>
            <li>A/C Sleeper (2+1)</li>            
            <li>NON A/C Hi-Tech (2+3)</li>   


           


         </p> 
  </div>




    )
}
export default Type;
